import React from 'react'
import FeedbackItem from './components/FeedbackItem'

export default function FeedbackList({data}) {
  return (
    <>
    {data.map((item =>{
        return (
            <p>{item.text}</p>
        )

    }))}
      <div><FeedbackItem data={data}/></div>
    </>

 )
}
